import React from "react";
function App() {
  return (
    <div className="container-fluid bg-primary text-white">
     <h1 className="header p-2">Hello World</h1>
     <div className="row mt-3">
       <div className="col-sm bg-info"><button className="btn btn-primary">Home</button></div>
       <div className="col-sm bg-dark"><button className="btn btn-info">Help</button></div>
       <div className="col-sm bg-warning"><button className="btn btn-info">Contact</button></div>
     </div>
    </div>
  );
}

export default App;
